import React from 'react'
import Nabvar from '../Components/Nabvar'
import { Router,Routes, Route } from 'react-router-dom'

export default function Login() {
  return (
    <Router>
        <Routes>
            <Route exaxt path="/" element={<Nabvar></Nabvar>}> </Route>
       </Routes>
      </Router>
  )
}
